import React, { Component } from 'react';
import { LoginForm } from "./loginComponent";
import { ListNew } from "./coba";

class RegisterForm extends Component{

    constructor(props) {
        super(props)
        this.state ={
            cobaStatus : true
        }
        this.handleClick = this.handleClick.bind(this)
    }

    handleClick() {
        this.setState(state => ({
            cobaStatus: !state.cobaStatus
        }) )
    }

    render() {
        return (
            
            <div>
                <h6> kalo udah punya akun bisa login <span onClick={this.handleClick}>{this.state.cobaStatus ? <ListNew/> : <LoginForm/>}</span> </h6>
            </div>
        )
    }

}



export default RegisterForm;
